import mapKeysWithValue from '../mapKeysWithValue';
import { formatJSVal } from '../testUtils';
describe('mapKeysWithValue', function () {
  var itHelper = function itHelper(input, obj, expected) {
    return it("For ".concat(formatJSVal(obj), " should be ").concat(formatJSVal(expected)), function () {
      expect(mapKeysWithValue(input, obj)).toEqual(expected);
    });
  };

  itHelper(function (key, value) {
    return value;
  }, {
    foo: 'bar',
    baz: 'boo'
  }, {
    bar: 'bar',
    boo: 'boo'
  });
});